  \"2015-05-06T22:17:30.884435\",\n\t\"name\": \"flexible-low-cost-avionics-for-nanosatellite-launch-vehicle-control-and-gps-metric-trackin\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this proposal, Tyvak Nano-Satellite Systems
  LLC (Tyvak) will develop nano-launch vehicle avionics solutions based on the latest
  commercial electronics products and protocols. These systems will address the unique
  avionic challenges of dedicated NanoSatellite launch vehicles (NLV). Tyvak will
  utilized heritage and lessons learned from its CubeSat avionic systems to modify
  and optimize its current products for use with this new class of launch vehicles.
  The major technical objectives will be:rnrn- Provide compatibility with the all
  NLV systems in developmentrnrn- Determine and provide appropriate performance and
  reliability metrics while maintaining the low-cost/low-mass made possible by commercial
  electronics systemsrnrn- Determine the feasibility of the latest network protocols
  (in particular wireless systems) in the NLV environmentrnrn- Demonstrate the reliability
  of low-cost/low-mass/low-power GPS based automatic flight termination system (AFTS)
  by combining the latest generation of commercial miniature GPS systems with high
  performance computer systems based on mobile computer technology\",\n\t\"license_title\":
